  render() {
    return (
      <Jumbotron fluid>
        <div>
          <div>
            <div>
              <Link className="navbar-brand" href="#home" to="/home">
                  <img className="custom-nav-logo"
                  src="logohero.png"
                  alt="StatHero Logo"
                  width="105px"
                  height="50px" />
              </Link>
            </div>
            <div>

            </div>
          </div>
        </div>
      </Jumbotron>
    )
  }
}
